import axios from 'axios';
import React, { useState } from 'react';
import URL from '../../Connection.js';
import { ToastContainer, toast } from 'react-toastify';

function Register() {

    const [register, setRegister] = useState({});
    function handleChange(e) {
        setRegister({
            ...register,
            [e.target.name]: e.target.value
        })
    }

    const handleSubmit = async () => {
        try {
            const response = await axios.post(`${URL}/User/register/`, register)
            toast.success("You are Registered!");
            console.log(response.data);
        } catch (error) {
            console.log(error);
            toast.error("Something went wrong")
        }
    }

    const style = {
        "display": "flex",
        boxShadow: "1px 12px 18px #888888",
        //     "flexDirection": "column",
        // "justifyContent": "center",
        // "alignItems": "center",
        // "border": "1px solid #ccc",
        "borderRadius": "5px",
        // "margin": "auto",
        "padding": "30px",
        "width": "650px"
    }

    return (
        <div className="container m-5 p-5">
            <div className="row" style={style}>
                <div className="col">
                    <h1>Register Staff</h1>
                    <div className="mb-3">
                        <label htmlFor="exampleInputUsername1" className="form-label">UserName</label>
                        <input type="Username" name='username' onChange={handleChange} className="form-control" id="exampleInputUsername1" aria-describedby="emailHelp" />

                    </div>

                    <div className="mb-3">
                        <label htmlFor="role" className="form-label">UserName</label>
                        <input type="role" name='role' onChange={handleChange} className="form-control" id="exampleInputUsername1" aria-describedby="emailHelp" />

                    </div>
                    <div className="mb-3">
                        <label htmlFor="exampleInputUsername1" className="form-label">UserName</label>
                        <input type="name" name='name' onChange={handleChange} className="form-control" id="exampleInputUsername1" aria-describedby="emailHelp" />

                    </div>
                    <div className="mb-3">
                        <label htmlFor="exampleInputUsername1" className="form-label">UserName</label>
                        <input type="shift" name='username' onChange={handleChange} className="form-control" id="exampleInputUsername1" aria-describedby="emailHelp" />

                    </div>
                    <div className="mb-3">
                        <label htmlFor="exampleInputUsername1" className="form-label">UserName</label>
                        <input type="Username" name='username' onChange={handleChange} className="form-control" id="exampleInputUsername1" aria-describedby="emailHelp" />

                    </div>
                    <div className="mb-3">
                        <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                        <input type="email" name='email' onChange={handleChange} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />

                    </div>
                    <div className="mb-3">
                        <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                        <input type="password" name='password' onChange={handleChange} className="form-control" id="exampleInputPassword1" />
                    </div>

                    <button type="submit" className="btn btn-primary" onClick={handleSubmit}>Submit</button>
                    <ToastContainer />
                </div>
            </div>
        </div>
    )
}

export default Register
